import React from 'react';
import '../../App.css';
import skillsData from './skillsData';

function Skills() {
  return (
    <div className="skills">
      <h3>Skills</h3>
      {skillsData.map((skill, index) => (
        <div key={index} className="skill">
          <img src={skill.image} alt={skill.name} />
          <p>{skill.caption}</p>
          <p>{skill.rating}</p>
        </div>
      ))}
    </div>
  );
}

export default Skills;
